import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Modal, TextInput, Button } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';
import { useNavigation } from '@react-navigation/native';
import AsyncStorage from '@react-native-async-storage/async-storage';

export default function Seller() {
  const navigation = useNavigation();
  const [isModalVisible, setModalVisible] = useState(false);
  const [fastFoodName, setFastFoodName] = useState('');
  const [fastFoodMenu, setFastFoodMenu] = useState('');
  const [fastFoodPrice, setFastFoodPrice] = useState('');
  const [menuList, setMenuList] = useState([]);
  const [scaleValue] = useState(new Animated.Value(1));

  useEffect(() => {
    loadMenuFromStorage();
  }, []);

  const toggleModal = () => {
    setModalVisible(!isModalVisible);
  };

  const handlePostMenu = async () => {
    const newItem = {
      fastFoodName,
      fastFoodMenu,
      fastFoodPrice,
    };

    const updatedMenuList = [...menuList, newItem];
    setMenuList(updatedMenuList);

    await saveMenuToStorage(updatedMenuList);

    setFastFoodName('');
    setFastFoodMenu('');
    setFastFoodPrice('');

    toggleModal();
  };

  const loadMenuFromStorage = async () => {
    try {
      const savedMenu = await AsyncStorage.getItem('menu');
      if (savedMenu) {
        const parsedMenu = JSON.parse(savedMenu);
        setMenuList(parsedMenu);
      }
    } catch (error) {
      console.error('Error loading menu from storage:', error);
    }
  };

  const saveMenuToStorage = async (menu) => {
    try {
      await AsyncStorage.setItem('menu', JSON.stringify(menu));
    } catch (error) {
      console.error('Error saving menu to storage:', error);
    }
  };

  return (
    <View style={styles.container}>
      <TouchableOpacity
        onPress={() => navigation.goBack()}
        style={styles.backButton}
      >
        <Icon name="arrow-left" size={24} color="black" />
      </TouchableOpacity>

      <Text style={styles.sectionTitle}>Seller</Text>
      
      {/* Display posted fast food names */}
      <View style={styles.postedFastFoods}>
        {menuList.map((menuItem, index) => (
          <Text key={index} style={styles.fastFoodItem}>{menuItem.fastFoodName}</Text>
        ))}
      </View>

      <TouchableOpacity onPress={toggleModal} style={styles.button}>
        <Text style={styles.buttonText}>Post Fast Food Menu</Text>
      </TouchableOpacity>

      <Modal
        animationType="slide"
        transparent={true}
        visible={isModalVisible}
      >
        <View style={styles.modalContainer}>
          <Text style={styles.modalTitle}>Post Fast Food Menu</Text>
          <TextInput
            placeholder="Fast Food Name"
            onChangeText={(text) => setFastFoodName(text)}
            value={fastFoodName}
            style={styles.input}
          />
          <TextInput
            placeholder="Fast Food Menu"
            onChangeText={(text) => setFastFoodMenu(text)}
            value={fastFoodMenu}
            style={styles.input}
          />
          <TextInput
            placeholder="Fast Food Price"
            onChangeText={(text) => setFastFoodPrice(text)}
            value={fastFoodPrice}
            style={styles.input}
          />
          <Button title="Post Menu" onPress={handlePostMenu} />
          <Button title="Close" onPress={toggleModal} />
        </View>
      </Modal>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 19,
    paddingHorizontal: 20,
    justifyContent: 'center',
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  backButton: {
    position: 'absolute',
    left: 20,
    top: 20,
  },
  button: {
    marginTop: 20,
    backgroundColor: 'blue',
    padding: 10,
    borderRadius: 5,
  },
  buttonText: {
    color: 'white',
    textAlign: 'center',
  },
  modalContainer: {
    flex: 1,
    justifyContent: 'center',
    paddingHorizontal: 20,
  },
  modalTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  input: {
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    marginBottom: 10,
    paddingHorizontal: 10,
  },
  // Style for displaying posted fast food names
  postedFastFoods: {
    marginTop: 20,
  },
  fastFoodItem: {
    fontSize: 16,
    marginBottom: 5,
  },
});
